const IconBase = ({
  children, className, color, size,
}) => {
  const modifiers = [
    !!color && `icon--${color}`,
    !!size && `icon--${size}`,
  ]
  const classNames = joinClassNames('icon', className, modifiers)

  return (
    <span className={classNames}>
      {children}
    </span>
  )
}

